import './App.css';
import { BrowserRouter, Route, Switch } from "react-router-dom";
// src/pages/index.js를 통해서 한번에 import 할 수 있도록 함
import Nav from "./pages/Nav";
import Main from "./pages/Main";
import eventAndFestival from "./pages/eventAndFestivalPage";
import HeaderMain from "./pages/contents/header/headerMain";
import HeaderMenu from "./pages/contents/header/headerMenu";

function App() {
  return (
    <BrowserRouter>
    <div class = "header">
      <headerMain/>
      <headerMenu/>
    </div>
      <Switch>
        <Route exact path="/" component={Main} />
        <Route exact path="/eventAndFestival" component={eventAndFestival} />
      </Switch>
    </BrowserRouter>
  );
}

export default App;
